.header {
    background: linear-gradient(230deg, #6d97ce, #a664d1);
    width: 80%;
    min-width: 360px;
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    flex-wrap: wrap;
    align-items: center;
    border-radius: 20px;
    margin-bottom: 20px;
    margin-top: 20px;

    h1 {
        font-size: 36px;
        line-height: 60px;
        color: #080225d0;
    }
}

#clock {
    font-size: 36px;
    display: table;
    color: #080225;
    background-color: #ffffff48;
    border-radius: 5px;
    padding: 5px;
}

.main {
    width: 75%;
    background: #cecdc7;
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    flex-wrap: wrap;
    min-width: 340px;
    border-radius: 10px;

    &>div {
        min-width: 300px;
        width: 30%;
        display: flex;
        flex-direction: column;
        align-items: center;
        position: relative;
        height: 100%;
        min-height: 60vh;
        margin: 10px 2px;
        border-radius: 10px;
        overflow: auto;
    }

    .todo-content-card {
        display: flex;
        flex-direction: column;
        align-items: center;
        flex: 1 1 auto;
        gap: 5px;

    }
}

.discription-header {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-around;
    top: 0;
    width: 100%;
    font-size: 20px;
    padding: 10px 0;
    margin-bottom: 5px;
}

