// карточка в столбце
.todo-card {
    display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
    justify-content: space-between;
    width: 95%;
    background: #ffeaa6;
    border: solid 1px #d38c21;

    .left-side {
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        padding: 5px 0 5px 2px;
        width: 50%;
    }

    .right-side {
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        align-items: flex-end;
        gap: 5px;
        padding: 5px 2px 5px 0;

        .control-button {
            display: flex;
            flex-direction: row;
            gap: 10px;

            button {
                width: 40px;
            }
        }
    }
}

